import React from 'react';
import ReactDOM from 'react-dom'
import ToDoTitle from "./to-do-title";
import ToDoSearch from "./to-do-search";

const ToDoHeader = () =>{
    return <header>
        <ToDoTitle/>
        <ToDoSearch/>
    </header>
}

export default ToDoHeader;
